import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import h from "./views/HomeView";

const App = () => {
    return (
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<Home />} />
        </Routes>
    </BrowserRouter>
    );
};

export default App;
